import React, { useState } from 'react';
import axios from 'axios';

const CreateAnimal = () => {
    const [animalData, setAnimalData] = useState({
        name: '',
        species: '',
        breed: '',
        gender: '',
        status: ''
    });

    const handleChange = (e) => {
        const { name, value } = e.target;
        setAnimalData(prevState => ({
            ...prevState,
            [name]: value
        }));
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        axios.post('http://localhost:8080/api/animals', animalData)
            .then(response => {
                console.log('Animal created:', response.data);
                // Optionally, you can redirect the user or perform any other action upon successful creation
            })
            .catch(error => {
                console.error('Error creating animal:', error);
            });
    };

    return (
        <div>
            <h2>Create New Animal</h2>
            <form onSubmit={handleSubmit}>
                <div>
                    <label>Name:</label>
                    <input type="text" name="name" value={animalData.name} onChange={handleChange} />
                </div>
                <div>
                    <label>Species:</label>
                    <input type="text" name="species" value={animalData.species} onChange={handleChange} />
                </div>
                <div>
                    <label>Breed:</label>
                    <input type="text" name="breed" value={animalData.breed} onChange={handleChange} />
                </div>
                <div>
                    <label>Gender:</label>
                    <input type="text" name="gender" value={animalData.gender} onChange={handleChange} />
                </div>
                <div>
                    <label>Status:</label>
                    <input type="text" name="status" value={animalData.status} onChange={handleChange} />
                </div>
                <button type="submit">Create Animal</button>
            </form>
        </div>
    );
};

export default CreateAnimal;
